A vitoria ta próxima. Quais devem ser o proximos passos?
- O povo deve escolher uma bancada de lideres;
- Após 24h do novo governo no poder, deve ser assinada uma carta demitindo todos os parlamentares, ministros e o atual presidente do Brasil. Essa carta deve ser entregue às FFAA:
- Esses lideres devem escrever uma carta destinada à nação declarando um novo governo interino;
- Esse governo deve declarar estado de exceção em todo territorio nacional;
- Esse governo deve buscar aliados no exterior;
- Esse novo governo deve convocar eleições em 120 dias;
- Esse novo governo deve instaurar um tribunal criminal para julgar crimes contra o estado brasileiro. A começar pelos generais das FFAA.


Espalhem para todos estarem cientes!!!

