- Parece que foi tudo armado pela própria esquerda;
- O governador do DF permite a manifestação na praça dos 3 poderes.
- Haviam muitos infiltrados no grupo de patriotas;
- Tudo já montado para a depredação;
- Não houve resistência à invasão por parte das forças militares;
- Lula já estava com o decreto de Intervenção federal pronto esperando esse ato para usar como justificativa, porque não deu tempo de escrever aquele decreto nesse tempo;
- As forças militares, incluindo o exército, até agora não se manifestaram
